import React from 'react';
import Form from 'react-bootstrap/Form';

const AddNewTodo = () => {

    const fnSubmit=(e)=>{
        e.preventDefault();
    }
  return (

    <div className='container p-5'>
              <form action='' onSubmit={fnSubmit}>
  
            <div class="input-group input-group-sm mb-3">
                <span class="input-group-text" id="todoId">Todo Id</span>
                <input type="number" class="form-control" aria-describedby="todoId" name='todoId' required/>
            </div>
            <div class="input-group input-group-sm mb-3">
                <span class="input-group-text" id="title">Title</span>
                <input type="text" class="form-control" aria-describedby="title" name='title' required/>
            </div>

            <div class="input-group input-group-sm mb-3">
                <span class="input-group-text" id="desc">Desc</span>
                <input type="text" class="form-control" aria-describedby="desc" name='desc' required/>
            </div>
            
            </form>
    </div>
  
  )
}

export default AddNewTodo
